import React from "react";
import styled from "styled-components";

const ModalLogin = () => {
    return (
        <>
            <Overlay>
                <ContenedorModal>
                    <EncabezadoModal>
                        <h1>Titulo</h1>                    
                    </EncabezadoModal>

                    <BotonCerrar></BotonCerrar>
                </ContenedorModal>
            </Overlay>
        </>
    );
}

export default ModalLogin;

const Overlay = styled.div`
    width: 100%;
    height: 100vh;
    position: fixed;
    top: 0;
    left: 0;
    background: rgba(0, 0, 0, .5)
    padding: 40px;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const ContenedorModal = styled.div`
    width: 500px;
    min-height: 100px;
    background: #fff;
    position: relative;
    border-radius: 5px;
    box-shadow: rgba(100,100,111,0.2) 0px 7px 29px 0px;
    padding: 20px;
`;
